const TransferCategory = () => {
  const transferCategoryItems = [
    "Без пересадок",
    "1 пересадка",
    "2 пересадка",
    "3 пересадка",
  ];
  return (
    <div className="category"> Количество пересадок
      <ul>
        {transferCategoryItems.map((item, index) => (
          <li key={index}>{item}</li>
        ))}
      </ul>
    </div>
  );
};

export default TransferCategory;
